        let imagealt = 'image'

    return <div className="add-area bg-after-sky mg-top--100">
			  <div className="container">
			    <a href="#"><img src={publicUrl+"assets/img/add/2.png"} alt="img" /></a>
			  </div>
			</div>

        }
}

export default Add
